import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import App from './components/Landing'; //Aquí vamos cambiando la línea (CardApp o Landing) hasta la lección 3.9.

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

